import React from 'react'

 const Employes = ({item , handelDelet}) => {
	const handelDelet1 = (id) => {
		handelDelet(id)
	}

  return (
<>
<td><img alt='no' className='images' src={item.img}/></td>
<td>{item.name}</td>
<td>{item.email}</td>
<td>{item.address}</td>
<td>{item.phone}</td>
	<td>
		<button  className="edit" data-toggle="modal"><i className="material-icons" data-toggle="tooltip" title="Edit">&#xE254;</i></button>
		<button onClick={ ()=> handelDelet1(item.id)} className="delete" data-toggle="modal"><i className="material-icons" data-toggle="tooltip" title="Delete">&#xE872;</i></button>
	</td>
</>
  )
}
export default Employes;
